import React from 'react';
import { Link } from 'react-router-dom';

function Product({donnee}){
    return(
     <>
      <div className='globale'>
      {donnees.map((element, index) => (
        <div key={index} className="element-image">
          <img src={element.image} alt={`Image {index + 1}`} />
          <div className='ligne3'></div>
          <h2>{element.titre}</h2>
          <p>{element.paragraphe}</p>
          <p>{element.price}</p>
        </div>
      ))}
      </div>

     </>
    )
    

}
export default Product({donnee});
